contract BEP20Token is Context, IBEP20, Ownable {
    using SafeMath for uint256;
    using SafeMath for uint8;

    mapping(address => uint256) private _balances;

    mapping(address => mapping(address => uint256)) private _allowances;

    uint256 private _totalSupply;
    uint8 private _decimals = 1;
    string private _symbol;
    string private _name;

    constructor() {
        _name = "Game Token";
        _symbol = "GAME";
        _decimals = 1;
        _totalSupply = 10 * (10**6) * (10**1);
        _balances[msg.sender] = _totalSupply;

        emit Transfer(address(0), msg.sender, _totalSupply);
    }

    event NewUser(address userId);
    event ChangeStatus(address userId);
    event DonateUser(address userId);

    struct User {
        uint8 index;
        uint8 marked;
        uint256 room;
        bool isReceive;
        bool isCreated; // flag is bot to init
        address[] donated; // flag interacted users
        address[] got; // flag interacted users
    }

    mapping(address => User) gameUser;
    address[] gameAddress;

    uint256[] rooms = [50 * (10 ** _decimals), 100 * (10 ** _decimals), 200 * (10 ** _decimals), 500 * (10 ** _decimals), 1000 * (10 ** _decimals)];

    function createUser(address _address) external onlyOwner {
        User storage userCreated = gameUser[_address];
        userCreated.index = 1;
        userCreated.isReceive = true;
        userCreated.isCreated = true;
        userCreated.donated = new address[](0);
        userCreated.got = new address[](0);

        gameAddress.push(_address);
        emit NewUser(_address);
    }

    function setUser(
        address _address,
        bool _state,
        bool _isEmpty
    ) external onlyOwner {
        setUserState(_address, _state);
        if (_isEmpty) {
            gameUser[_address].donated = new address[](0);
            gameUser[_address].got = new address[](0);
        }
    }

    function getUser(address _address) external view returns (User memory) {
        return gameUser[_address];
    }

    function getRooms() external view returns (uint256[] memory) {
        return rooms;
    }

    function addRoom(uint256 _amount) external onlyOwner {
        rooms.push(_amount);
    }

    function setUserState(address _address, bool _state) internal {
        gameUser[_address].isReceive = _state;
    }

    function checkExistsUser(address _address) public view returns (bool) {
        return gameUser[_address].index > 0;
    }

    function getUserState(address _address) public view returns (bool) {
        return gameUser[_address].isReceive;
    }

    function getUserDonated(address _address)
        public
        view
        returns (address[] memory)
    {
        return gameUser[_address].donated;
    }

    function getUserGot(address _address)
        public
        view
        returns (address[] memory)
    {
        return gameUser[_address].got;
    }

    function donateToken(address _recipient, uint256 _amount)
        external
        override
    {
        require((msg.sender != _recipient), "Self send");
        require(
            (_balances[msg.sender] >= _amount),
            "Insufficient token balance"
        );
        require(
            (gameUser[msg.sender].marked < 2 &&
                !gameUser[msg.sender].isReceive),
            "Can not give now"
        );
        require(
            _isDonated(msg.sender, _recipient),
            string(abi.encodePacked("Gave this account ", msg.sender, " to ", _recipient))
        );
        require(gameUser[_recipient].isReceive, "Receiver can not receive");

        if (gameUser[msg.sender].index < 1) {
            User storage userCreated = gameUser[msg.sender];
            userCreated.index = 1;
            userCreated.marked = 0;
            userCreated.room = rooms[0];
            userCreated.isReceive = false;
            userCreated.isCreated = false;
            userCreated.donated = new address[](0);
            gameAddress.push(msg.sender);
        }

        if (gameUser[msg.sender].room > 0) {
            require(gameUser[msg.sender].room == _amount * (10 ** _decimals), "Please select right room amount");
        }
        if (!gameUser[_recipient].isCreated) {
            require(gameUser[_recipient].room == _amount * (10 ** _decimals), "Please select right user room amount");
        }

        _balances[msg.sender] = _balances[msg.sender].sub(
            _amount,
            "donate amount exceeds balance"
        );
        _balances[_recipient] = _balances[_recipient].add(_amount);

        gameUser[msg.sender].donated.push(_recipient);
        gameUser[_recipient].got.push(msg.sender);
        gameUser[msg.sender].marked.add(1);
        gameUser[_recipient].marked.add(1);

        if (
            gameUser[msg.sender].marked > 1 &&
            !gameUser[msg.sender].isReceive
        ) {
            gameUser[msg.sender].isReceive = true;
            gameUser[msg.sender].marked = 0;
            emit NewUser(msg.sender);
            emit ChangeStatus(msg.sender);
        }

        if (
            gameUser[_recipient].marked > 3 &&
            !gameUser[_recipient].isCreated
        ) {
            gameUser[_recipient].isReceive = false;
            gameUser[_recipient].marked = 0;
            uint256 currentLevel = 0;
            for (currentLevel = 0; currentLevel < rooms.length; currentLevel++) {
                if (gameUser[_recipient].room == rooms[currentLevel]) {
                    break;
                }
            }
            gameUser[_recipient].room = rooms[currentLevel.add(1)];
            emit ChangeStatus(msg.sender);
        }

        emit DonateUser(msg.sender);
        emit DonateUser(_recipient);
    }

    function _isDonated(address _from, address _recipient)
        internal
        view
        returns (bool)
    {
        if (gameUser[_from].index > 0) {
            bool notAllow = true;
            for (uint256 i = 0; i < gameUser[_from].donated.length; i++) {
                if (gameUser[_from].donated[i] == _recipient) {
                    notAllow = false;
                    break;
                }
            }
            return notAllow;
        } else {
            return true;
        }
    }

    /**
     * @dev Returns the bep token owner.
     */
    function getGameAddress() external view returns (address[] memory) {
        return gameAddress;
    }

    function getOwner() external view override returns (address) {
        return owner();
    }

    /**
     * @dev Returns the token decimals.
     */
    function decimals() external view override returns (uint8) {
        return _decimals;
    }

    /**
     * @dev Returns the token symbol.
     */
    function symbol() external view override returns (string memory) {
        return _symbol;
    }

    /**
     * @dev Returns the token name.
     */
    function name() external view override returns (string memory) {
        return _name;
    }

    /**
     * @dev See {BEP20-totalSupply}.
     */
    function totalSupply() external view override returns (uint256) {
        return _totalSupply;
    }

    /**
     * @dev See {BEP20-balanceOf}.
     */
    function balanceOf(address account)
        external
        view
        override
        returns (uint256)
